    false,nt"url": null,nt"notes": "The Wash Flats impoundments comprise an
    area of approximately 1,200 acres. Prior to 1963, the Wash Flats was subject to
    periodic wash-over during extremely high tides and severe storms. The existing dike
    and road have been constructed since the 1962 storm which flattened the dunes and
    washed over into the bay. This plan outlines how the refuge will manage the varied
    habitats and species found on the Wash Flats areas of Chincoteague National Wildlife
